define({"topics" : [{"title":"Setting HTML parameters","shortdesc":"<p class=\"shortdesc\">For simple branded HTML pages, you can adjust the look and feel of the default output to match your company     style by setting parameters to include custom CSS, header branding, or table-of-contents navigation in topics.     (These changes do not require a custom plug-in.)</p>","href":"topics\/html-customization-parameters.html","attributes": {"data-id":"custom-html-parameters",},"menu": {"hasChildren":false,},"tocID":"custom-html-parameters-d50e1090","next":"custom-html-parameters-d50e1090",},{"title":"Using a properties file","shortdesc":"<p class=\"shortdesc\">You can also use a <span class=\"ph filepath\">.properties</span> file to reference a set of build parameters when     building output with the <span class=\"keyword cmdname\">dita</span> command. The DITA-OT documentation uses a       <span class=\"ph filepath\">.properties</span> file to include custom CSS, header branding, and table-of-contents navigation in     the HTML5 output.</p>","href":"topics\/html-customization-properties-file.html","attributes": {"data-id":"custom-html-properties-file",},"menu": {"hasChildren":false,},"tocID":"custom-html-properties-file-d50e1201","topics":[]},{"title":"Custom HTML plug-ins","shortdesc":"<p class=\"shortdesc\">For more complex customizations, you can create custom DITA-OT plug-ins that build on the default XHTML and     HTML5 transformations, bundle custom stylesheets, modify the HTML markup, or override other aspects of HTML     processing.</p>","href":"topics\/html-customization-plugins.html","attributes": {"data-id":"custom-html-plugins",},"menu": {"hasChildren":false,},"tocID":"custom-html-plugins-d50e1231","next":"custom-html-plugins-d50e1231",}]});